import { makeStyles,Typography} from '@material-ui/core'


const useStyles=makeStyles(theme=>({

heading:{
    fontSize:'',
    textAlign:'center'
}

}))


const Food = () => {
    const classes=useStyles()
    return (
        <>
         <div>
             <Typography className={classes.heading} >Food Item</Typography>
             </div>   
        </>
    )
}

export default Food
